const SignUpDetails=[
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"text",
    for:"fname",
    labelC:"col-2",
    name:"First Name:",
    inputC:"form-control col-3",
    placeholder:"First Name"
  },
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"text",
    for:"lname",
    labelC:"col-2",
    name:"Last Name:",
    inputC:"form-control col-3",
    placeholder:"Last Name"
  },
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"",
    for:"id_num",
    labelC:"col-2",
    name:"ID:",
    inputC:"form-control col-3",
  },
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"text",
    for:"city",
    labelC:"col-2",
    name:"City:",
    inputC:"form-control col-3",
    placeholder:"City"
  },
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"text",
    for:"street",
    labelC:"col-2",
    name:"Street:",
    inputC:"form-control col-3",
    placeholder:"street"
  },
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"text",
    for:"zip",
    labelC:"col-2",
    name:"Zip Code:",
    inputC:"form-control col-3",
    placeholder:"Zip code"
  },
  {
    id:"multiCollapse1",
    classN:"row mt-5",
    type:"email",
    for:"email",
    labelC:"col-2",
    name:"E-mail:",
    inputC:"form-control col-3",
    placeholder:"Enter your Email"
  },
  {
    id:"multiCollapse1",
    classN:"row mt-5",
    type:"tel",
    for:"phone",
    labelC:"col-2",
    name:"Phone Number:",
    inputC:"form-control col-3",
    placeholder:"Enter your Phone Number",
  },
  {
    id:"multiCollapse1",
    classN:"row mt-5",
    type:"date",
    for:"BirthDate",
    labelC:"col-2 col-form-label",
    name:"Date of birth:",
    inputC:"form-control col-3",
  }

]
export default SignUpDetails
